import React from "react";
import ReactDOM from "react-dom";
import Header from "./Header";
import Footer from "./Footer";

function Train(props)
{
    return(
        <div>
            <h1>{props.no}</h1>
            <h1>{props.trainName}</h1>
            <h1>{props.Rate}</h1>
        </div>
    );
}
function App()
{
    return (
        <div>
            <Header></Header>
            <Footer></Footer>
            <Train
                no="1"
                trainName="Trilok Guru"
                Rate="1000"
            />
            
        </div>
    );
}
export default App;
